
def skew(sequence):

	numberOfG = 0
	numberOfC = 0
	minSkew = 0
	minList = []
	position = 0

	for i in range(len(sequence)):
		position += 1
		if sequence[i] == 'C':
			numberOfC += 1
		elif sequence[i] == 'G':
			numberOfG += 1

		currSkew = numberOfG - numberOfC
		if currSkew < minSkew:
			minSkew = currSkew
			minList = [position]  #position of min skew

		if currSkew == minSkew and position not in minList: #other min point
			minList.append(position)

	return minList

